        pdfa = jsp.pdfa;
        pd = jsp.pd;
        var html = request(input);
        var dw = pdfh(html,'head&&style:eq(2)&&Html').match(/.*(\\..*?):hover/)[1];
        log('dw ===> ' + dw)
